import styled from 'styled-components';

export const Container = styled.div`
  background-color: red;
  min-width: 100%;
  height: 100px;
  display: flex;
  justify-content: center;
  align-items: center;

  .teste{
    background-color: blue;
    min-width: 90%;
    display: flex;
    justify-content: space-between;
    align-items: center;

    ul{
      list-style: none;

      li{
        float: left;
        padding-left: 10px;
      }

    }

  }
`;
